import React from 'react'

const axios = require('axios')

function Users() {
    var arr = null
    var getUser = () => {
        axios.get('http://localhost:5000/api/dummy')
        .then( function(response) {
            console.log(response)
            arr = response.data
        })
        .catch(function (error) {
            console.log(error);
          })
    }

    return <>
    <button onClick = {getUser}>Show all users</button>
    <div>{arr}</div>
    </>
}

export default Users
